import React from "react";

function Chatspace() {
  // Sample data
  const formData = {
    profile: "https://example.com/avatar.png", // Replace with an actual URL to an image
  };

  const containerStyle = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    padding: "20px",
    border: "1px solid #ccc",
    borderRadius: "8px",
    // maxWidth: "400px",
    margin: "0 auto",
  };

  const headerStyle = {
    display: "flex",
    alignItems: "center",
    marginBottom: "20px",
  };

  const avatarStyle = {
    width: "50px",
    height: "50px",
    borderRadius: "50%",
    marginRight: "10px",
  };

  const profileNameStyle = {
    fontSize: "18px",
    fontWeight: "bold",
  };

  const messagesStyle = {
    display: "flex",
    flexDirection: "column",
    marginBottom: "20px",
  };

  const messageStyle = {
    backgroundColor: "#f2f2f2",
    padding: "10px",
    borderRadius: "8px",
    marginBottom: "5px",
  };

  const inputStyle = {
    padding: "10px",
    width: "100%",
    borderRadius: "8px",
    border: "1px solid #ccc",
  };

  return (
    <div style={containerStyle}>
      <div style={headerStyle}>
        <img src={formData.profile} alt="avatar" style={avatarStyle} />
        <span style={profileNameStyle}>John Doe</span>
      </div>
      <div style={messagesStyle}>
        <h3 style={messageStyle}>Message 1</h3>
        <h3 style={messageStyle}>Message 2</h3>
        <h3 style={messageStyle}>Message 3</h3>
        <h3 style={messageStyle}>Message 4</h3>
      </div>
      <div>
        <input placeholder="Write your text" style={inputStyle} />
      </div>
    </div>
  );
}

export default Chatspace;
